public boolean equals(Object o) {
  if (o == null) 
    return false;
  if (this == o) 
    return true;
  if (! (o instanceof ProtoNameVer))
    return false;
  ProtoNameVer pv = (ProtoNameVer) o;
  return ((pv.protocol.equals(this.protocol)) && 
      (pv.version == this.version));     
}
